  spaceToLeave(totalAmt, max) {
    let spaces = String(totalAmt).length - String(max).length;
    return (spaces * 2.5)
  }



  appendwithspaces(amount) {
    let d = "";
    for (let i = 0; i < String(this.max).length - String(amount).length; i++) {
      d = d + "  ";
    }
    return d + amount;
  }
